import React, { useState, useEffect } from "react";
import logo from "../../assets/images/sankalptaru-new-logo-white.png";
import { styled } from "@mui/material/styles";
import Box from "@mui/material/Box";
import Paper from "@mui/material/Paper";
import Grid from "@mui/material/Grid";
import PersonIcon from "@mui/icons-material/Person";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import AccountCircleIcon from "@mui/icons-material/AccountCircle";
import { useMediaQuery, useTheme } from "@mui/material";
import { useNavigate } from "react-router-dom";
import MenuIcon from "@mui/icons-material/Menu";
const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#e3e0ab",
}));

const Header = ({ userid }) => {
  const navigate = useNavigate();
  const theme = useTheme();
  const matches = useMediaQuery(theme.breakpoints.down("md"));
  const [entry, setEntry] = useState("");
  var nm = JSON.parse(sessionStorage.getItem("userid"));

  useEffect(() => {
    const requestOptions = {
      method: "GET",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(),
    };
    fetch(`http://127.0.0.1:8000/api/user/${userid}`)
      .then((res) => res.json())
      .then((json) => setEntry(json));
  }, []);
  return (
    <div className="headercontainer">
      <Box
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "space-between",
        }}
      >
        <Box>
          <img
            src={logo}
            id="logo"
            onClick={() => navigate("/")}
            style={{ marginLeft: "5px", height: "50px" }}
          ></img>
        </Box>
        {matches ? (
          ""
        ) : (
          <Box style={{ display: "flex", alignItems: "center" }}>
            <Box className="boxheader">
              <Item onClick={() => navigate("/AboutUs")} className="headertags">
                ABOUT US
              </Item>
            </Box>
            <Box>
              <Item onClick={() => navigate("/")} className="headertags">
                <a href="/#gallery">GALLERY</a>
              </Item>
            </Box>
            <Box>
              <Item
                onClick={() => navigate("/ContactUs")}
                className="headertags"
              >
                CONTACT
              </Item>
            </Box>
            {/* <Box>
                    <Item  onClick={()=>navigate("/ContactUs")}className='headertags'>CAREERS</Item>
                </Box> */}
          </Box>
        )}

        <Box
          style={{
            display: "flex",
            alignItems: "center",
            margin: "10px 10px 10px 10px",
            justifyContent: "center",
          }}
        >
          <Box>
            <div onClick={() => navigate("/PlantNow")} className="plantnow">
              PLANT A TREE
            </div>
          </Box>
          <Box
            style={{
              marginRight: "10px",
              display: "flex",
              flexDirection: "column",
              alignItems: "center",
            }}
          >
            <Box className="rightheader">
              <ShoppingCartIcon
                onClick={() => navigate("/Cart")}
                className="loginbuttonheader"
                style={{ color: "white", fontSize: "25px", display: "block" }}
              />
            </Box>
            <Box>
              <p
                onClick={() => navigate("/Cart")}
                className="loginbuttonheader"
                style={{ color: "white", marginTop: "2px", fontSize: "15px" }}
              >
                CART
              </p>
            </Box>
          </Box>

          <Box style={{ marginRight: "5px" }}>
            <Box className="rightheader">
              <AccountCircleIcon
                onClick={() => {
                  nm ? navigate("/Account") : navigate("/Login");
                }}
                className="loginbuttonheader"
                style={{ color: "white", fontSize: "20px" }}
              />
            </Box>
            <Box>
              <p
                onClick={() => {
                  nm ? navigate("/Account") : navigate("/Login");
                }}
                className="loginbuttonheader"
                style={{ color: "white", marginTop: "2px", fontSize: "15px" }}
              >
                {nm ? "ACCOUNT" : "LOGIN"}
              </p>
            </Box>
          </Box>
          {matches ? (
            ""
          ) : (
            <Box style={{ marginRight: "10px" }}>
              <Box className="rightheader">
                <MenuIcon
                  onClick={() => navigate("/Menu")}
                  className="loginbuttonheader"
                  style={{ color: "white", fontSize: "23px", display: "block" }}
                />
              </Box>
              <Box>
                <p
                  onClick={() => navigate("/Menu")}
                  className="loginbuttonheader"
                  style={{ color: "white", marginTop: "2px", fontSize: "15px" }}
                >
                  MENU
                </p>
              </Box>
            </Box>
          )}
        </Box>
      </Box>
    </div>
  );
};

export default Header;
